import React from "react";

const Bot = ({ bot, onEnlist, onRelease, onDischarge }) => {
  const handleEnlist = () => {
    onEnlist(bot);
  };

  const handleRelease = () => {
    onRelease(bot);
  };

  const handleDischarge = () => {
    onDischarge();
  };

  return (
    <div className="bot">
      <h3>{bot.name}</h3>
      <p>{bot.description}</p>
      <button onClick={handleEnlist}>Enlist</button>
      <button onClick={handleRelease}>Release</button>
      <button onClick={handleDischarge}>Discharge All</button>
    </div>
  );
};

export default Bot;
